const style = "background-color: #333; color: #eee; margin: 0; padding: 0;"

const Header = (function() {
	function Header() {}
	
	Header.prototype = {
		render: function() {
			return `
				<header style=${style}>
					<h1>My App</h1>
					<nav>
						<ul>
							<li>Home</li>
						</ul>
					</nav>
				</header>
			`
		}
	}

	return Header
})()

module.exports = {
	Header
}

